import React from 'react';

const GoalList = () => {
    return (
        <ul className="goal-list"> 
      <li> Finish the Course </li>
      <li> Learn all about the Course Main Topics </li>
      <li> Help other students in the Q&amp;A </li>
    </ul>
    );

};

export default GoalList;
